import React from 'react';
import {Link, Switch, Route} from 'react-router-dom';
import UserareaComponent from '../ui/userarea.component';


const LoginComponent: React.FC = () => {
    return (
        <React.Fragment>
        <div className="login_form">
        <div className="login_credentials">
            <br></br>
        <span>Username: </span>
        <input type = "text" id="username" name="user"></input>
        <br></br>
        <span>Password: </span>
        <input type = "password" id="password" name="password"></input>
        <br></br><br></br>
        <button className="login_button"><Link to="/userarea">Login</Link></button>
       
        <br></br><br></br>
        </div>
        </div>
        <Switch>
            <Route path ="/userarea" component= {UserareaComponent}></Route>
        </Switch>
        </React.Fragment>
    )
}

export default LoginComponent;
